import { CHECK_ROOM } from "./types";

export const checkRoom = id => (dispatch, getState) => {
  const room = getState;
  console.log(room);

  dispatch({
    type: CHECK_ROOM,
    payload: id
  });
};

export const nextPage = () => (dispatch, getState) => {
  //console.log("next page...");
  const currentpage = getState().movies_obj.page;
  if (getState().movies_obj.page < 500) {
    dispatch({
      type: CHANGE_PAGE,
      payload: currentpage + 1
    });
  }
};
